import React from 'react'
import './App.css';
import {Formik} from 'formik'
import InfoForm from './components/InfoForm';
import PaymentDataForm from './components/PaymentDataForm';


function App() {
  return (
    <div className="App">
      <form>
        <InfoForm />
        <PaymentDataForm />
      </form>
    </div>
  );
}

export default App;
